import React, { Component } from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from "react-router-dom";

import Top from './pages/top';
import Trending from './pages/trending';
import Science from './pages/science';
import Entertainment from './pages/entertainment';
import Sports from './pages/sports';

export default class Navigationbar extends Component {
    render() {
        const handleSelect = (eventKey) => alert(`selected ${eventKey}`);
        return (
            <Router>
                <div>
                    <Navbar expand="lg" className="bg-body-tertiary main-nav" bg="primary" data-bs-theme="dark" fixed='top'>
                        <Container className='nav-sub-container'>
                            <Navbar.Brand href="#home">Newssie</Navbar.Brand>
                            <Navbar.Toggle aria-controls="basic-navbar-nav" />
                            <Navbar.Collapse id="basic-navbar-nav">
                                <Nav className="ms-auto" variant="pills" activeKey="1" onSelect={handleSelect}>
                                    <Nav.Link className='nav-link-a' eventKey="1">Home</Nav.Link>
                                    <Nav.Link as={Link} to="/top" className='nav-link-a' eventKey="2">Top</Nav.Link>
                                    <Nav.Link as={Link} to="/trending" className='nav-link-a' eventKey="3">Trending</Nav.Link>
                                    <Nav.Link as={Link} to="/science" className='nav-link-a' eventKey="4">Science</Nav.Link>
                                    <Nav.Link as={Link} to="/entertainment" className='nav-link-a' eventKey="5">Entertainment</Nav.Link>
                                    <Nav.Link as={Link} to="/sports" className='nav-link-a' eventKey="6" style={{ marginRight: '0px !important' }}>Sports</Nav.Link>
                                </Nav>
                            </Navbar.Collapse>
                        </Container>
                    </Navbar>
                </div>
                <div>
                    <Routes>
                        <Route path="/top" element={<Top />} />
                            
                        <Route path="/trending" element={<Top />} />
                            
                        <Route path="/science" element={<Top />} />
                            
                        <Route path="/entertainment" element={<Top />} />
                            
                        <Route path="/sports" element={<Top />} />
                            
                    </Routes>
                </div>
            </Router>
        )
    }
}
